import './App.css';

function App() {
  return (
    <div className="App">
      <h1>반입금지 셀프 체크</h1>
      <p><a onClick="">금지 물품</a>은 <span className="red_background">빨간색</span>으로</p>
      <p><a>기내 또는 위탁 가능 물품</a>은 <span className="green_background">초록색</span>으로</p>
      <p><a>크기 또는 용량 제한 물품</a>은 <span className="yellow_background">노란색</span>으로</p>
      <p>표시됩니다. 사진을 업로드해주세요!</p>

      <div className="card">
        <p><strong>업로드 전 체크해주세요</strong></p>
        <ul className="check">
          <li>무늬가 없는 배경에서 촬영해주세요</li>
          <li>물품 전체가 나오도록 촬영해주세요</li>
        </ul>
      </div>

      <button className="btn">셀프 체크 시작</button>
    </div>
  );
}

export default App;
